import { FaPhoneAlt } from "react-icons/fa";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCar, faCarSide, faDollarSign } from '@fortawesome/free-solid-svg-icons';
import { useState, useEffect } from 'react';

// Import images
import backgroundImage1 from './images/newcar.jpeg';
import backgroundImage2 from './images/car3.jpeg';
import backgroundImage3 from './images/ne.jpeg';

// Array of imported images
const images = [backgroundImage1, backgroundImage2, backgroundImage3];

export default function Home() {
  const [currentImage, setCurrentImage] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prevImage) => (prevImage + 1) % images.length);
    }, 5000); // Change image every 5 seconds

    // Clean up the interval on component unmount
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="bg-gray-100">
      {/* Navbar */}
      <nav className="bg-white text-black py-4 px-6 flex justify-between items-center shadow-md">
        <h1 className="text-2xl font-bold text-black">STOCKYTOW</h1>
        <div className="space-x-6">
          <a href="#" className="hover:text-orange-500">Home</a>
          <a href="#" className="hover:text-orange-500">About</a>
          <a href="#" className="hover:text-orange-500">Services</a>
          <a href="#" className="hover:text-orange-500">Contact</a>
        </div>
        <button className="bg-orange-500 text-white px-4 py-2 rounded-lg hover:bg-orange-600">
          Get a Quote
        </button>
      </nav>

      {/* Header with Background Slider */}
      <header
        className="relative text-white text-center py-20"
        style={{
          backgroundImage: `url(${images[currentImage]})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
          minHeight: "500px",
          transition: "background-image 1s ease-in-out",
        }}
      >
        
      </header>

      {/* Car Sales Section */}
      <section className="py-16 px-8 grid grid-cols-1 md:grid-cols-3 gap-6 text-center">
        <div className="bg-gradient-to-r from-orange-400 via-orange-500 to-orange-600 p-6 rounded-lg shadow-lg hover:shadow-xl transform hover:scale-105 transition-all duration-300 ease-in-out">
          {/* Icon for New Cars */}
          <div className="text-4xl text-white mb-4">
            <FontAwesomeIcon icon={faCar} />
          </div>
          <h3 className="text-xl font-semibold text-white">New Cars</h3>
          <p className="text-gray-200 mt-2">Browse the latest car models with the newest features and advanced technology.</p>
          <p className="text-gray-200 mt-2">Visit our showroom or schedule a test drive today.</p>
        </div>
        <div className="bg-gradient-to-r from-orange-400 via-orange-500 to-orange-600 p-6 rounded-lg shadow-lg hover:shadow-xl transform hover:scale-105 transition-all duration-300 ease-in-out">
          {/* Icon for Pre-owned Cars */}
          <div className="text-4xl text-white mb-4">
            <FontAwesomeIcon icon={faCarSide} />
          </div>
          <h3 className="text-xl font-semibold text-white">Pre-Owned Cars</h3>
          <p className="text-gray-200 mt-2">Certified pre-owned cars in great condition, inspected and ready for the road.</p>
          <p className="text-gray-200 mt-2">Great deals on well-maintained used cars with warranties.</p>
        </div>
        <div className="bg-gradient-to-r from-orange-400 via-orange-500 to-orange-600 p-6 rounded-lg shadow-lg hover:shadow-xl transform hover:scale-105 transition-all duration-300 ease-in-out">
          {/* Icon for Financing */}
          <div className="text-4xl text-white mb-4">
            <FontAwesomeIcon icon={faDollarSign} />
          </div>
          <h3 className="text-xl font-semibold text-white">Financing Options</h3>
          <p className="text-gray-200 mt-2">Flexible financing options available to fit your budget and needs.</p>
          <p className="text-gray-200 mt-2">Get pre-approved for a loan in minutes and start your car buying journey.</p>
        </div>
      </section>

      {/* About Section */}
      <section className="py-16 px-8 bg-white text-center">
        <h3 className="text-3xl font-bold">A Little Care for Your Great Problems</h3>
        <p className="text-gray-600 mt-4">
          Our towing services ensure you’re never stranded. Contact us for quick assistance.
        </p>
        <div className="mt-6 flex justify-center items-center space-x-4">
          <FaPhoneAlt className="text-yellow-500 text-2xl" />
          <span className="text-xl font-semibold">(888) 400-234</span>
        </div>
      </section>

      {/* Call-to-Action Section */}
      <section className="relative bg-blue-900 text-white py-16 text-center">
        <h3 className="text-3xl font-bold">Getting Your Tow Truck on the Road</h3>
        <p className="mt-4 text-lg">
          Trust us for fast and professional towing services anytime, anywhere.
        </p>
        <button className="mt-6 bg-yellow-500 px-6 py-3 rounded-lg text-blue-900 font-bold">
          Contact Us
        </button>
      </section>

      {/* Footer */}
      <footer className="py-6 bg-gray-900 text-white text-center">
        <p>© 2024 StockyTow. All rights reserved.</p>
      </footer>
    </div>
  );
}
